import React from "react";
import { Route } from "react-router-dom";
function Index() {
  return <h2>home</h2>;
}
function List() {
  return <h2>List</h2>;
}
function List2() {
  return (
    <div>
      <h2>List2</h2>
    </div>
  );
}

function list() {
  return (
    <div>
      {/* <Link to="/">首页</Link> <Link to="/list/">列表</Link>{" "} */}
      <Route exact path="/" component={Index} />
      <Route exact path="/li" component={List} />
      <Route exact path="/li/2" component={List2} />
    </div>
  );
}
export default list;
